// src/components/PriceBreakdown.js

import React from 'react';
import '../styles/App.css';

const PriceBreakdown = ({ breakdown }) => {
  return (
    <div className="breakdown">
      <div>Base Price: ${breakdown.base_price}</div>
      <div>
        Distance: {breakdown.distance_km} km Ã— {breakdown.per_km_rate} = ${breakdown.distance_cost}
      </div>
      <div>Cab Type Factor: {breakdown.cab_type_factor}</div>
      <div>Surge Factor: {breakdown.surge_factor}</div>
      <div>Time Factor: {breakdown.time_factor}</div>
      <div>Fluctuation: ${breakdown.fluctuation}</div>
      <strong>Total: ${breakdown.final_price}</strong>
    </div>
  );
};

export default PriceBreakdown;
